import { useEffect, useRef } from "react";
import * as d3 from "d3";
import { getGitpodService } from "./service/service";

export default function Insights() {
    const svgRef = useRef<SVGSVGElement>(null);
    const iframeRef = useRef<HTMLIFrameElement>(null);
    const width = 800;
    const height = 560;
    const data = getData();

    useEffect(() => {
        if (!svgRef.current) {
            return;
        }

        const margin = { top: 20, right: 20, bottom: 35, left: 40 };
        const x = d3.scaleLog([200, 1e5], [margin.left, width - margin.right]);
        const y = d3.scaleLinear([14, 86], [height - margin.bottom, margin.top]);

        const radius = d3.scaleSqrt([0, 5e8], [0, width / 24]);
        const color = d3.scaleOrdinal(data.map(d => d.region), d3.schemeCategory10).unknown("black")

        const xAxis = (g: any) => g
            .attr("transform", `translate(0,${height - margin.bottom})`)
            .call(d3.axisBottom(x).ticks(width / 80, ","))
            .call((g: any) => g.select(".domain").remove())
            .call((g: any) => g.append("text")
                .attr("x", width)
                .attr("y", margin.bottom - 4)
                .attr("fill", "currentColor")
                .attr("text-anchor", "end")
                .text("Income per capita (dollars) â†’"));

        const yAxis = (g: any) => g
            .attr("transform", `translate(${margin.left},0)`)
            .call(d3.axisLeft(y))
            .call((g: any) => g.select(".domain").remove())
            .call((g: any) => g.append("text")
                .attr("x", -margin.left)
                .attr("y", 10)
                .attr("fill", "currentColor")
                .attr("text-anchor", "start")
                .text("â†‘ Life expectancy (years)"));

        const grid = (g: any) => g
                .attr("stroke", "currentColor")
                .attr("stroke-opacity", 0.1)
                .call((g: any) => g.append("g")
                    .selectAll("line")
                    .data(x.ticks())
                    .join("line")
                        .attr("x1", (d: number) => 0.5 + x(d))
                        .attr("x2", (d: number) => 0.5 + x(d))
                        .attr("y1", margin.top)
                        .attr("y2", height - margin.bottom))
                .call((g: any) => g.append("g")
                    .selectAll("line")
                    .data(y.ticks())
                    .join("line")
                        .attr("y1", (d: number) => 0.5 + y(d))
                        .attr("y2", (d: number) => 0.5 + y(d))
                        .attr("x1", margin.left)
                        .attr("x2", width - margin.right));

        const bisectDate = d3.bisector(([date]) => date).left;

        function valueAt(values: any, date: number) {
            const i = bisectDate(values, date, 0, values.length - 1);
            const a = values[i];
            if (i > 0) {
                const b = values[i - 1];
                const t = (date - a[0]) / (b[0] - a[0]);
                return a[1] * (1 - t) + b[1] * t;
            }
            return a[1];
        }

        function dataAt(date: number) {
            return data.map(d => ({
                name: d.name,
                region: d.region,
                income: valueAt(d.income, date),
                population: valueAt(d.population, date),
                lifeExpectancy: valueAt(d.lifeExpectancy, date)
            }));
        }

        const svg = d3.select(svgRef.current).attr("viewBox", [0, 0, width, height]);

        svg.append("g")
            .call(xAxis);

        svg.append("g")
            .call(yAxis);

        svg.append("g")
            .call(grid);

        const circle = svg.append("g")
                .attr("stroke", "black")
            .selectAll("circle")
            .data(dataAt(1800), (d: any) => d.name)
            .join("circle")
                .sort((a, b) => d3.descending(a.population, b.population))
                .attr("cx", d => x(d.income))
                .attr("cy", d => y(d.lifeExpectancy))
                .attr("r", d => radius(d.population))
                .attr("fill", d => color(d.region))
                .call(circle => circle.append("title")
                    .text(d => [d.name, d.region].join("\n")));

        // circle.data(data, (d: any) => d.name)
        //     .sort((a, b) => d3.descending(a.population, b.population))
        //     .attr("cx", d => x(d.income))
        //     .attr("cy", d => y(d.lifeExpectancy))
        //     .attr("r", d => radius(d.population));

        const chart = Object.assign(svg.node(), {
            update(data: any) {
                circle.data(data, (d: any) => d.name)
                    .sort((a, b) => d3.descending(a.population, b.population))
                    .attr("cx", d => x(d.income))
                    .attr("cy", d => y(d.lifeExpectancy))
                    .attr("r", d => radius(d.population));
            }
        });

        chart.update(data);
    }, []);


    useEffect(() => {
        const win = iframeRef?.current?.contentWindow;
        const doc = iframeRef?.current?.contentDocument || win?.document
        console.log('doc?.readyState', doc?.readyState);
        if (win && doc && doc.readyState === 'complete') {
            win.postMessage(getData());
        }
    }, [iframeRef?.current?.contentWindow, iframeRef?.current?.contentDocument, (iframeRef?.current?.contentDocument || win?.document)?.readyState]);

    useEffect(() => {
        getGitpodService().server.getProjectUsageData('').then(data => {
            console.log('project usage data', data);
        });
    }, []);

    return <div className="mt-24 mx-auto flex flex-col items-stretch">
        <h1 className="text-center">ðŸ§¼ BUBBLES</h1>
        <div className="mt-8">
            <iframe src="/bubbles.html" ref={iframeRef} ></iframe>
            <svg className="container" ref={svgRef}></svg>
        </div>
    </div>
}

